 select count(1), universaluniqueid From #d with(nolock) group by universaluniqueid having count(1) > 1

delete from #d where universaluniqueid in ('42318fca-5bec-41cb-982f-4b99c50f9c7b','ea2028c3-96fb-43a0-a8c2-bef0c965d380','ff2b91dd-efcd-436f-8637-67833625a47b')

select * From #d with(nolock)

--non charge-off population
select sh.acctid,sh.accountnumber,bp.universaluniqueid,d.disamt,d.purchasedate,sh.statementdate,sh.CycleDueDTD,sh.systemstatus,
sh.ccinhparent125aid,sh.currentbalance,sh.amountoftotaldue,sh.amountofpaymentsctd,sh.amountofcreditsctd
From statementheader sh with(nolock) 
join bsegment_primary bp with(nolock) on bp.acctid = sh.acctid
join #d d with(nolock) on d.universaluniqueid = bp.universaluniqueid
where sh.statementdate > d.purchasedate and sh.CycleDueDTD > 2 and bp.systemstatus <> 14
order by sh.acctid,sh.statementdate

--charge-off population
select sh.acctid,sh.accountnumber,bp.universaluniqueid,d.disamt,d.purchasedate,sh.statementdate,sh.CycleDueDTD,sh.systemstatus,
sh.ccinhparent125aid,sh.currentbalance,sh.amountoftotaldue,sh.amountofpaymentsctd,sh.amountofcreditsctd
From statementheader sh with(nolock) 
join bsegment_primary bp with(nolock) on bp.acctid = sh.acctid
join #d d with(nolock) on d.universaluniqueid = bp.universaluniqueid
where sh.statementdate > d.purchasedate and sh.CycleDueDTD > 2 and bp.systemstatus = 14
order by sh.acctid,sh.statementdate

--------------------------PULL Statement Data
--drop table #DIS_IntCycle
select sh.acctid,sh.accountnumber,bp.universaluniqueid,d.disamt,d.purchasedate,sh.statementdate,sh.laststatementdate,sh.CycleDueDTD,sh.systemstatus,
sh.ccinhparent125aid,sh.currentbalance+sh.currentbalanceco as currentbalance,sh.amountoftotaldue,sh.amtofpaycurrdue,sh.amountofpaymentsctd,
sh.amountofcreditsctd,csu.interestatcycle,su.amtofinterestctd,suc.interestfeecreditctd,su.amtofinterestctd - csu.interestatcycle as MidCylinterestctd,
case when row_number() over (partition by sh.acctid order by sh.statementdate) = 1 and EOMONTH(d.purchasedate) = EOMONTH(sh.statementdate) 
then datediff(dd,d.purchasedate,sh.statementdate) else su.daysincycle end as daysincycle,
su.APR,row_number() over (partition by sh.acctid,sh.statementdate order by sh.statementdate) as RN,
case when year(sh.statementdate) in (2020) then 366 else 365 end as yearbase,
row_number() over (partition by sh.acctid order by sh.statementdate) as CNT,
bp.currentbalance as IntAmt,bp.currentbalance as bsfc,bcc.retailplans,cast(0 as money) as NonRRTotalDue,cast(0 as money) as NonRRCurrentDue,
cast(0 as money) as NonRRCB
into #DIS_IntCycle
From statementheader sh with(nolock) 
join summaryheader su with(nolock) on su.parent02aid = sh.acctid and su.statementid = sh.statementid
join currentsummaryheader csu with(nolock) on su.acctid = csu.acctid and su.statementid = csu.statementid
join summaryheadercreditcard suc with(nolock) on su.acctid = suc.acctid and su.statementid = suc.statementid
join bsegment_primary bp with(nolock) on bp.acctid = sh.acctid
join bsegmentcreditcard bcc with(nolock) on bp.acctid = bcc.acctid
join #d d with(nolock) on d.universaluniqueid = bp.universaluniqueid
where sh.statementdate > d.purchasedate and su.creditplantype = '0' and csu.interestatcycle > 0 
and sh.statementdate <= '2021-07-31 23:59:57.000'

--drop table #DIS_AllCycle
select sh.acctid,sh.accountnumber,bp.universaluniqueid,d.disamt,d.purchasedate,sh.statementdate,sh.laststatementdate,sh.CycleDueDTD,sh.systemstatus,
sh.ccinhparent125aid,sh.currentbalance+sh.currentbalanceco as currentbalance,sh.amountoftotaldue,sh.amtofpaycurrdue,
sh.AmtOfPayXDLate,sh.AmountOfPayment30DLate,sh.AmountOfPayment60DLate,
sh.AmountOfPayment90DLate,sh.AmountOfPayment120DLate,sh.AmountOfPayment150DLate,
sh.AmountOfPayment180DLate,sh.AmountOfPayment210DLate,sh.ChargeOffDate,
sh.amountofpaymentsctd,sh.amountofcreditsctd,csu.interestatcycle,su.amtofinterestctd,suc.interestfeecreditctd,su.amtofinterestctd - csu.interestatcycle as MidCylinterestctd,
csu.amtofinterestctd as AdjInterestCTD,csu.currentbalance as RR_AdjCB,csu.currentbalance as RRC_AdjCB,csu.currentbalance as BK_AdjCB,
case when row_number() over (partition by sh.acctid order by sh.statementdate) = 1 and EOMONTH(d.purchasedate) = EOMONTH(sh.statementdate) 
then datediff(dd,d.purchasedate,sh.statementdate) else su.daysincycle end as daysincycle,
su.APR,row_number() over (partition by sh.acctid,sh.statementdate order by sh.statementdate) as RN,
case when year(sh.statementdate) in (2020) then 366 else 365 end as yearbase,
row_number() over (partition by sh.acctid order by sh.statementdate) as CNT,
cast(0 as money) as IntAmt,cast(0 as money) as bsfc,bcc.retailplans,
cast(0 as money) as RRC_TotalDue,cast(0 as money) as RRC_CurrentDue,cast(0 as money) as RRC_PastDue,cast(0 as money) as RRC_CB,
cast(0 as money) as BK_TotalDue,cast(0 as money) as BK_CurrentDue,cast(0 as money) as BK_PastDue,cast(0 as money) as BK_CB,
cast(0 as money) as RR_TotalDue,cast(0 as money) as RR_CurrentDue,cast(0 as money) as RR_PastDue,cast(0 as money) as RR_CB,
cast(NULL as int) as DisputePosted
into #DIS_AllCycle
From statementheader sh with(nolock) 
join summaryheader su with(nolock) on su.parent02aid = sh.acctid and su.statementid = sh.statementid
join currentsummaryheader csu with(nolock) on su.acctid = csu.acctid and su.statementid = csu.statementid
join summaryheadercreditcard suc with(nolock) on su.acctid = suc.acctid and su.statementid = suc.statementid
join bsegment_primary bp with(nolock) on bp.acctid = sh.acctid
join bsegmentcreditcard bcc with(nolock) on bp.acctid = bcc.acctid
join #d d with(nolock) on d.universaluniqueid = bp.universaluniqueid
where sh.statementdate > d.purchasedate and su.creditplantype = '0' and sh.statementdate <= '2021-07-31 23:59:57.000'

select cp.bsacctid 
into #DisputePosted
From #d d with(nolock)
join bsegment_primary bp with(nolock) on bp.universaluniqueid = d.universaluniqueid
join ccard_primary cp with(nolock) on cp.accountnumber = bp.accountnumber
where cmttrantype = '110' and cp.transactionamount = d.disamt

update #DIS_AllCycle set DisputePosted = 1 where acctid in (select bsacctid from #DisputePosted with(nolock))

select acctid,statementdate,count(1)
--into #p
from #DIS_AllCycle with(nolock) group by acctid,statementdate having count(1) > 1

delete from #DIS_AllCycle where RN > 1

update #DIS_AllCycle set MidCylinterestctd = 0 where MidCylinterestctd < 0

--drop table #STMT_INT
;with cte as
(
	select acctid,statementdate,disamt,apr,bsfc, daysincycle,yearbase from #DIS_IntCycle with(nolock) 
),cte_1 as
(
	select C.*,round((disamt * POWER (1 + (round(cast (apr as float)/cast(100 as float),10)) * (round(cast (1 as float)/cast(yearbase as float),10)),isnull(daysincycle,0)) - disamt),10) as IntAmt FROM CTE C
),CTE_2 AS
(
	select c.*,sum(intamt) over (partition by acctid order by statementdate) as RunningInt from cte_1 C
),CTE_3 AS 
(
select *,(RunningInt - intAmt) AS BSFCForInt from CTE_2
),CTE_4 AS
(
	select *,round((BSFCForInt * POWER (1 + (round(cast (apr as float)/cast(100 as float),10)) * (round(cast (1 as float)/cast(yearbase as float),10)),isnull(daysincycle,0)) - BSFCForInt),10) as IntOnINt from cte_3 
)
select *,round(intAmt + IntOnINt,2) as STMT_INT, round((disamt + runningint - intamt),2) as STMT_CB
into #STMT_INT
from cte_4 

--drop table #RR_PLAN
select d.acctid,d.statementdate,sum(su.amountoftotaldue) as totaldue,sum(csu.currentdue) as currentdue,sum(su.currentbalance+csu.currentbalanceco) as CB,
sum(isnull(c.interestatcycle,0)) as interestatcycle,sum(isnull(su.amtofinterestctd,0)) as amtofinterestctd,sum(isnull(csu.interestfeecreditctd,0)) as interestfeecreditctd
,sum(isnull(c.amtofinterestctd,0)) as AdjInterestCTD,sum(isnull(c.currentbalance,0)) as AdjCB
into #RR_PLAN
from summaryheader su with(nolock) 
join summaryheadercreditcard csu with(nolock) on su.acctid = csu.acctid and su.statementid = csu.statementid
join currentsummaryheader c with(nolock) on su.acctid = c.acctid and su.statementid = c.statementid
join #DIS_AllCycle d with(nolock) on d.acctid = su.parent02aid and su.statementdate = d.statementdate
where su.creditplantype = '0' group by d.acctid,d.statementdate

update rr set rr.AdjCB = case when DisputePosted is not null and DisputePosted = 1 then rr.AdjCB else d.disamt end
from #DIS_AllCycle d with(nolock) join #RR_PLAN rr with(nolock) on rr.acctid = d.acctid

--drop table #RRC_PLAN
select d.acctid,d.statementdate,sum(su.amountoftotaldue) as totaldue,sum(csu.currentdue) as currentdue,sum(su.currentbalance+csu.currentbalanceco) as CB,
sum(isnull(c.amtofinterestctd,0)) as AdjInterestCTD,sum(isnull(c.currentbalance,0)) as AdjCB
into #RRC_PLAN
from summaryheader su with(nolock) 
join summaryheadercreditcard csu with(nolock) on su.acctid = csu.acctid and su.statementid = csu.statementid
join currentsummaryheader c with(nolock) on su.acctid = c.acctid and su.statementid = c.statementid
join #DIS_AllCycle d with(nolock) on d.acctid = su.parent02aid and su.statementdate = d.statementdate
where su.creditplantype = '10' group by d.acctid,d.statementdate

--drop table #BK_PLAN
select d.acctid,d.statementdate,sum(su.amountoftotaldue) as totaldue,sum(csu.currentdue) as currentdue,sum(su.currentbalance+csu.currentbalanceco) as CB,
sum(isnull(c.amtofinterestctd,0)) as AdjInterestCTD,sum(isnull(c.currentbalance,0)) as AdjCB
into #BK_PLAN
from summaryheader su with(nolock) 
join summaryheadercreditcard csu with(nolock) on su.acctid = csu.acctid and su.statementid = csu.statementid
join currentsummaryheader c with(nolock) on su.acctid = c.acctid and su.statementid = c.statementid
join #DIS_AllCycle d with(nolock) on d.acctid = su.parent02aid and su.statementdate = d.statementdate
where su.creditplantype = '16' group by d.acctid,d.statementdate

