--drop table #TemFinal
select d.acctid,d.accountnumber,d.universaluniqueid,d.disamt,d.purchasedate,d.statementdate ,d.laststatementdate,d.CycleDueDTD,d.systemstatus,
d.ccinhparent125aid,
d.rr_cb+d.rrc_cb+bk_cb currentbalance,d.amountoftotaldue,d.amtofpaycurrdue,d.AmtOfPayXDLate,d.AmountOfPayment30DLate,d.AmountOfPayment60DLate,
d.AmountOfPayment90DLate,d.AmountOfPayment120DLate,d.AmountOfPayment150DLate,
d.AmountOfPayment180DLate,d.AmountOfPayment210DLate,d.ChargeOffDate,
d.amountofpaymentsctd,d.amountofcreditsctd,d.interestatcycle,d.amtofinterestctd,d.MidCylinterestctd,d.interestfeecreditctd,d.retailplans,
d.RRC_TotalDue,d.RRC_CurrentDue,d.RRC_PastDue,
d.RRC_CB,BK_TotalDue,d.BK_CurrentDue,d.BK_PastDue ,d.BK_CB, d.RR_TotalDue , d.RR_CurrentDue,d.RR_PastDue,d.RR_CB,
d.AdjInterestCTD,d.RR_AdjCB + isnull(s.STMT_INT,0) RR_AdjCB,d.RRC_AdjCB,d.BK_AdjCB,cast('' as varchar(500)) as RR_Reason, 
case when d.interestatcycle - d.AdjInterestCTD + isnull(d.MidCylinterestctd,0) - isnull(d.interestfeecreditctd,0) > 0 
then d.interestatcycle - d.AdjInterestCTD + isnull(d.MidCylinterestctd,0) - isnull(d.interestfeecreditctd,0) else 0 end as NetIntImpact,
case when isnull(d.MidCylinterestctd,0) - isnull(d.interestfeecreditctd,0) > 0  then isnull(d.MidCylinterestctd,0) - isnull(d.interestfeecreditctd,0) else 0  end as MidIntDrCR,
 isnull(s.STMT_INT,0) as STMT_INT,
 isnull(s.STMT_CB,0) STMT_CB,
 cast(0 as money) as REC_RRCB,cast(0 as money) as REC_RRTotalDue, cast(0 as money) as REC_RRCurrentDue,cast(0 as money) as REC_RRPastDue, 
 cast(0 as money) as DIFF, cast('' as VARCHAR(100)) as PHPAction
 into #TemFinal
From #DIS_AllCycle d with(nolock) 
left join #STMT_INT s with(nolock) on d.acctid = s.acctid and d.statementdate = s.statementdate

