--update #DIS_AllCycle set RRC_AdjCB = 0, RR_AdjCB = 0, BK_AdjCB = 0,AdjInterestCTD = 0
--update #TemFinal set RRC_AdjCB = 0, RR_AdjCB = 0, BK_AdjCB = 0,AdjInterestCTD = 0

update #TemFinal set REC_RRCurrentDue = CASE WHEN (RR_CB - RR_AdjCB) < 1 THEN 0 
WHEN (RR_CB - RR_AdjCB) >= 1 and Interestatcycle - AdjInterestCTD >= 0 
THEN ((0.01 * (RR_CB - RR_AdjCB)) + NetIntImpact)
WHEN (RR_CB - RR_AdjCB) >= 1 and Interestatcycle - AdjInterestCTD  < 0 
THEN (0.01 * (RR_CB - RR_AdjCB) + MidIntDrCR) END,
RR_Reason = CASE WHEN (RR_CB - RR_AdjCB) < 1 THEN 'Credit Balance' 
WHEN (RR_CB - RR_AdjCB) >= 1 and Interestatcycle - AdjInterestCTD > 0 THEN 'Partial Int CR'
WHEN (RR_CB - RR_AdjCB) >= 1 and Interestatcycle - AdjInterestCTD <= 0 THEN 'Full Int CR' END

update #temfinal set REC_RRCurrentDue = RR_CB - RR_AdjCB where (RR_CB - RR_AdjCB) >= 1 and REC_RRCurrentDue > 0 
and REC_RRCurrentDue > (RR_CB - RR_AdjCB)

