(RR_CB - RR_AdjCB + RRC_CB - RRC_AdjCB) RR_RRC_CBNEW,
(RR_CB - RR_AdjCB + RRC_CB - RRC_AdjCB + BK_CB - BK_AdjCB) BSCBNEW,*
INTO #TempFinal2N
From #TemFinal with(nolock) order by acctid,statementdate

