--update #TempFinal2N set RR_RRC_CDNEW = 0 where RR_RRC_CBNEW < 0 and  RR_RRC_CDNEW > 0

--drop table #TempFinal2
select cast(
--CASE WHEN ccinhparent125aid in ('15996','16000','16326','16330') then 0
CASE WHEN  RR_RRC_CBNEW < 1 then 0
WHEN  RR_RRC_CDNEW >= 25  and (RR_RRC_CDNEW + rr_pastdue + rrc_pastdue) > RR_RRC_CBNEW then (RR_RRC_CDNEW + rr_pastdue + rrc_pastdue) - (RR_RRC_CDNEW + rr_pastdue + rrc_pastdue - RR_RRC_CBNEW)
WHEN  RR_RRC_CDNEW >= 25  and (RR_RRC_CDNEW + rr_pastdue + rrc_pastdue) <= RR_RRC_CBNEW then RR_RRC_CDNEW
when RR_RRC_CDNEW <= 25 and RR_RRC_CBNEW >= 25 and (25 + rr_pastdue + rrc_pastdue) > RR_RRC_CBNEW then (25 + rr_pastdue + rrc_pastdue) - (25 + rr_pastdue + rrc_pastdue - RR_RRC_CBNEW)
when RR_RRC_CDNEW <= 25 and RR_RRC_CBNEW >= 25 and (25 + rr_pastdue + rrc_pastdue) <= RR_RRC_CBNEW then 25
--when RR_RRC_CDNEW < 25 and RR_RRC_CBNEW < 25 and (25 + rr_pastdue + rrc_pastdue) >= RR_RRC_CBNEW then 25 - (25 + rr_pastdue + rrc_pastdue - RR_RRC_CBNEW)
WHEN  RR_RRC_CDNEW < 25  and (RR_RRC_CDNEW + rr_pastdue + rrc_pastdue) > RR_RRC_CBNEW then (RR_RRC_CDNEW + rr_pastdue + rrc_pastdue) - ((RR_RRC_CDNEW + rr_pastdue + rrc_pastdue) - RR_RRC_CBNEW)
when RR_RRC_CDNEW <= 25 and RR_RRC_CBNEW <= 25 and RR_RRC_CBNEW > RR_RRC_CDNEW then RR_RRC_CBNEW - rr_pastdue - rrc_pastdue
when RR_RRC_CDNEW <= 25 and RR_RRC_CBNEW <= 25 and RR_RRC_CBNEW <= RR_RRC_CDNEW then RR_RRC_CBNEW  - rr_pastdue - rrc_pastdue
else -10 end as money) RR_RRC_CurrentDUEAtStmt , row_number() over (partition by acctid  order by statementdate) as RN, *
INTO #TempFinal2
From #TempFinal2N with(nolock) order by acctid,statementdate

